import React from 'react';

class Card extends React.Component {
    render() {
        return (
            <div>
                <h2 className="py-1">Stuff you should know</h2>
                <p className="p-3">
                    This is important
                </p>

                <p>
                    <a
                        className="App-link"
                        href="https://www.linkedin.com/home/?originalSubdomain=no"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                        LinkedIN
                    </a>
                </p>

            </div>
        );
    }
}


export default Card;
